import React, { useState, useEffect } from 'react';
import { Routes, Route, Link, Navigate } from "react-router-dom";
import Home from './Routes/Home';

import './App.css';

function App() {
  return (
    <div className="App">
      <Link to="/home" />}
    <div>
      <Routes>
            <Route path="/home" element={<Home />} />
        </Routes>
    </div>
    </div>
  );
}

export default App;
